const state = {
  permissions: [],
};

const mutations = {
  setPermissions(state, permissions) {
    state.permissions = permissions;
  },
  resetPermissions(state) {
    state.permissions = [];
  },
};

const getters = {
  getPermissions(state) {
    return state.permissions;
  },
};

export default {
  namespaced: true,
  state,
  mutations,
  getters,
};
